import React from 'react';
import  { Button, Checkbox, Form, Input, Card } from 'antd';
import './SignUp.css';

function SignUp() {

    const onFinish = (values) => {
        console.log('Success:', values);
      };
      const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
      };
  return (
    <>
      <h1 className='heading-1'>Sign In</h1>
     <Card
     hoverable style={{width: 620}}
     className="site-card-border-less-wrapper card">
      <Form
      className=' form'
      name="basic"
      labelCol={{
        span: 4,
      }}
      wrapperCol={{
        span: 16,
      }}
      initialValues={{
        remember: true,
      }}
      onFinish={onFinish}
      onFinishFailed={onFinishFailed}
      autoComplete="off"
    >
      <Form.Item
        className='form-item1'
        label="Username"
        name="username"
        rules={[
          {
            required: true,
            message: 'Please input your username!',
          },
        ]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        className='form-item1'
        label="User Email"
        placeholder="Enter Your Email"
        name="Email"
        rules={[
          {
            required: true,
            message: 'Please input your Email!',
          },
        ]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Password"
        name="password"
        rules={[
          {
            required: true,
            message: 'Please input your password!',
          },
        ]}
      >
        <Input.Password />
      </Form.Item>

      <Form.Item
        label="Re-Password"
        name="Re-password"
        rules={[
          {
            required: true,
            message: 'Please input your Re-password!',
          },
        ]}
      >
        <Input.Password />
      </Form.Item>

      <Form.Item
        
        name="remember"
        valuePropName="checked"
        wrapperCol={{
          offset: 3,
          span: 16,
        }}
      >
        <Checkbox>Creating an account means youâ€™re okay with our Terms of Service, Privacy Policy.</Checkbox>
      </Form.Item>

      <Form.Item
        wrapperCol={{
          offset: 3,
          span: 16,
        }}
      >
        <Button type="primary" htmlType="submit">
          Sign Up
        </Button>
      </Form.Item>
    </Form>
    </Card>
    </>
  )
}

export default SignUp
